using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;
using System.Collections.Generic;
using TacticsWarMud.TypeDefinitions;

namespace TacticsWarMud.SystemDefinition
{
    public partial class SpawnSystemDeployment : SpawnSystemDeploymentBase
    {
        public SpawnSystemDeployment() : base(BYTECODE) { }
        public SpawnSystemDeployment(string byteCode) : base(byteCode) { }
    }

    public class SpawnSystemDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public SpawnSystemDeploymentBase() : base(BYTECODE) { }
        public SpawnSystemDeploymentBase(string byteCode) : base(byteCode) { }

    }

    public partial class CommitSpawnFunction : CommitSpawnFunctionBase { }

    [Function("tacticsWar__commitSpawn")]
    public class CommitSpawnFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_commitHash", 1)]
        public virtual byte[] CommitHash { get; set; }
        [Parameter("bytes32", "_matchEntity", 2)]
        public virtual byte[] MatchEntity { get; set; }
    }

    public partial class RevealSpawnFunction : RevealSpawnFunctionBase { }

    [Function("tacticsWar__revealSpawn")]
    public class RevealSpawnFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_matchEntity", 1)]
        public virtual byte[] MatchEntity { get; set; }
        [Parameter("tuple[]", "_coordinates", 2)]
        public virtual List<PositionData> Coordinates { get; set; }
        [Parameter("bytes32[]", "_pieceEntities", 3)]
        public virtual List<byte[]> PieceEntities { get; set; }
        [Parameter("bytes32", "_secret", 4)]
        public virtual byte[] Secret { get; set; }
    }
}